,'Brain, Behavior, and Evolution','237-251','79',NULL,'2013-01-28 22:08:36','2013-01-28 22:08:36'),(165,'Abstract\r\nSubventricular zone (SVZ) progenitors are a hallmark of the developing neocortex. Recent studies described a novel type of SVZ progenitor that retains a basal process at mitosis, sustains expression of radial glial markers, and is capable of self-renewal. These progenitors, referred to here as basal radial glia (bRG), occur at high relative abundance in the SVZ of gyrencephalic primates (human) and nonprimates (ferret) but not lissencephalic rodents (mouse). Here, we analyzed the occurrence of bRG cells in the embryonic neocortex of the common marmoset Callithrix jacchus, a near-lissencephalic primate. bRG cells, expressing Pax6, Sox2 (but not Tbr2), glutamate aspartate transporter, and glial fibrillary acidic protein and retaining a basal process at mitosis, occur at similar relative abundance in the marmoset SVZ as in human and ferret. The proportion of progenitors in M-phase was lower in embryonic marmoset than developing ferret neocortex, raising the possibility of a longer cell cycle. Fitting the gyrification indices of 26 anthropoid species to an evolutionary model suggested that the marmoset evolved from a gyrencephalic ancestor. Our results suggest that a high relative abundance of bRG cells may be necessary, but is not sufficient, for gyrencephaly and that the marmoset\'s lissencephaly evolved secondarily by changing progenitor parameters other than progenitor type.',22114084,'Kelava I, Reillo I, Murayama AY, Kalinka AT, Stenzel D, Tomancak P, Matsuzaki F, Lebrand C, Sasaki E, Schwamborn JC, Okano H, Huttner WB, Borrell V.','Abundant Occurrence of Basal Radial Glia in the Subventricular Zone of Embryonic Neocortex of a Lissencephalic Primate, the Common Marmoset Callithrix jacchus','Cerebral cortex','469-481','22',NULL,'2013-03-13 20:50:30','2013-03-13 20:50:30'),(166,'MCFARLIN, S. C., et al. (2012). Early Brain Growth Cessation in Wild Virun