INSERT INTO `pages` VALUES (1,'The Model','model',1,'<h2>The Model</h2>\r\n<h3><a href=\"http://www.jneurosci.org/content/33/17/7368.full\" target=\"_blank\">Based on:&nbsp;Workman AD, Charvet CJ, Clancy B, Darlington RB, Finlay BL. 2013. Modeling&nbsp;transformations of neurodevelopmental sequences across mammalian species. J Neurosci. <span class=\"slug-vol\">33</span><span class=\"slug-issue\">:</span><span class=\"slug-pages\">&nbsp;7368-7383</span>.&nbsp;</a></h3>\r\n<p>&nbsp;</p>\r\n<h3>Basic Model&nbsp;</h3>\r\n<p>A general model of neural development is derived to fit 18 mammalian species, including humans, macaques, several rodent species, and 6 marsupial mammals. The empirical data generating the model comprises 271 developmental events. These events include measures of initial neurogenesis, axon extension, establishment and refinement of connections, as well as later events such as myelin formation, brain growth and early behavioral milestones. Our model now predicts events during postnatal development, which occurs up to the third year of human postnatal life.&nbsp;The present model was fitted to the data with the &ldquo;quasi-Newton&rdquo; form of optimization, which is discussed&nbsp;in &nbsp;Workman et al. 2013,.&nbsp;This method accounts for the fact that brains of different species mature at different rates by assigning a slope and a constant to each species. The interaction terms account for the fact that there are heterochronic shifts in a subset of events across species.</p>\r\n<p>The regression predicts post conception (PC) dates for each species, which has the form:</p>\r\n<p align=\"center\"><strong>Y = onset + slope*eventscale</strong> &nbsp;<strong>+ interaction term</strong></p>\r\n<p>This quasi-newton method has been fitted simultaneously to all cells with data, but it also generates estimates for the cells with no empirical data. The correlation between predicted dates and empirical dates is r=0.993 (Workman et al., 2013).&nbsp;Please note that for the data in this model, the values are measured from a species typical estimate of conception (PC 0). The day of birth is considered postnatal day 0 (PN0).</p>\r\n<p>Although we are confident the predictions and comparisons for the neural events that are included in our database will be of value, we suggest careful interpretation. Please consult the confidence interval of the predicted dates. The model will not be accurate for any dates that lie outside the range of empirical events in this database. The user can translate timing of events that fall within the range of data for any of the 18 species in the model.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>Understanding the interaction terms:</h3>\r\n<p>Our interaction terms reflect heterochronic changes in developmental schedules between species. Specifically, we have an interaction term for cortical neurogenesis for all examined species (primates, carnivores, ungulate, marsupials ) but the rodents and rabbits. That is, cortical neurogenesis is relatively delayed in all species but the rodents and rabbits. Also, retinal neurogenesis is delayed in the cat with respect to all examined species and has its interaction term (see Workman et al., 2013).&nbsp;</p>\r\n<p>&nbsp;</p>','','','2013-01-31 21:45:35','2013-04-24 17:08:17'),(2,'References','home',1,'<h2>Overview</h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"48%\">\r\n<p>Because clinicians and researchers rely on neurodevelopment data obtained from a variety of non-human species, it is essential to be able to relate studies across the different experimental animals, and ultimately to humans, in an easily accessible format. This web site is based on a database originally assembled by <a id=\"ref1\" href=\"http://www.ncbi.nlm.nih.gov/pubmed/7777856\" target=\"_blank\">Finlay and Darlington, 1995</a>&nbsp;that finds equivalent post conception (PC) dates across mammalian species. The model has subsequently been refined in <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/11483296\" target=\"_blank\">Clancy et al. 2001</a> and most recently in <a href=\"http://www.jneurosci.org/content/33/17/7368.full\" target=\"_blank\">Workman et al., 2013</a>. The model now integrates over 1,000 empirically-derived neural events to translate neurodevelopment time across 18 mammalian species (placental and marsupial mammals) including hamsters, mice, rats, rabbits, spiny mice, guinea pigs, ferrets, opossums, cats, rhesus monkeys and humans.</p>\r\n<h3>Citation Information:</h3>\r\n<h4>If you use information from this web page, please cite the following article:&nbsp;</h4>\r\n<h4><a href=\"http://www.jneurosci.org/content/33/17/7368.full\" target=\"_blank\">Workman AD, Charvet CJ, Clancy B, Darlington RB, Finlay BL. 2013. Modeling&nbsp;transformations of neurodevelopmental sequences across mammalian species. J Neurosci.&nbsp;<span class=\"slug-vol\">33</span><span class=\"slug-issue\">:</span><span class=\"slug-pages\">&nbsp;7368-7383.</span></a></h4>\r\n</td>\r\n<td width=\"4%\">&nbsp;</td>\r\n<td valign=\"top\" width=\"48%\">\r\n<p><a href=\"/translate\"><img src=\"/assets/translate-button.jpg\" border=\"0\" /></a></p>\r\n<p><a href=\"/predict\"><img src=\"/assets/predict-button.jpg\" border=\"0\" /></a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><img src=\"/assets/divider2.jpg\" border=\"0\" /></p>\r\n<h1>&nbsp;</h1>\r\n<h1>New model as of April, 2013!</h1>\r\n<h1>&nbsp;</h1>\r\n<table style=\"width: 100%;\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"50%\">\r\n<h3>Changes to the model include:</h3>\r\n<ul>\r\n<li>New Species (marsupial and additional precocial mammals)</li>\r\n<li>New Events (up to third year of post-natal life in humans; myelination, brain growth, behavioral milestones)</li>\r\n<li>Revised Model&nbsp;</li>\r\n</ul>\r\n</td>\r\n<td valign=\"top\" width=\"50%\">\r\n<h3>Previous users note!</h3>\r\n<ul>\r\n<li>Given this is a new model, the predicted dates will vary from those of the prior model. The most change should be expected in the latest predicted dates of the prior model because of the influence of new later events.&nbsp;</li>\r\n<li>Instructions on the new model can be found <a href=\"http://staging.translatingtime.net/Instructions\" target=\"_blank\">here</a>.&nbsp;</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><img src=\"/assets/divider2.jpg\" border=\"0\" /></p>\r\n<h3>Site Authored By:</h3>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"50%\">\r\n<h4><a href=\"http://www.nsf.gov/\">U</a>niversity of Central Arkansas</h4>\r\n</td>\r\n<td width=\"50%\">\r\n<h4>&nbsp; &nbsp; &nbsp;Cornell University</h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\"><span class=\"Apple-style-span\" style=\"line-height: 20px;\">Barbara Clancy, PhD</span><br /><span class=\"Apple-style-span\" style=\"line-height: 20px;\"><br /></span></td>\r\n<td valign=\"top\"><span class=\"Apple-style-span\" style=\"line-height: 20px;\">&nbsp; &nbsp; &nbsp; Christine J. Charvet, PhD &nbsp;&nbsp;</span><br /><span class=\"Apple-style-span\" style=\"line-height: 20px;\">&nbsp; &nbsp; &nbsp; Richard B. Darlington, PhD&nbsp;</span><br /><span class=\"Apple-style-span\" style=\"line-height: 20px;\">&nbsp; &nbsp; &nbsp; Barbara L. Finlay, PhD &nbsp;&nbsp;</span><br /><span class=\"Apple-style-span\" style=\"line-height: 20px;\">&nbsp; &nbsp; &nbsp; Alan Workman</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>&nbsp;</h3>\r\n<h3>Site Supported By:</h3>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td width=\"50%\"><a href=\"http://www.nsf.gov/\" target=\"_blank\">National Science Foundation</a></td>\r\n<td width=\"50%\">&nbsp; &nbsp; &nbsp;<a href=\"http://www.nih.gov/\" target=\"_blank\">National Institutes of Health</a></td>\r\n</tr>\r\n<tr>\r\n<td>DBI0848612; DBI0849627</td>\r\n<td>&nbsp; &nbsp; &nbsp;P20 RR16460</td>\r\n</tr>\r\n<tr>\r\n<td>DBI0849626; DBI0849684</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>The current authors gratefully acknowledge the contributions of&nbsp;<a href=\"http://staging.translatingtime.net/brandon-kersh\" target=\"_blank\"><span class=\"il\">Brandon</span>&nbsp;Kersh</a> to the founding of the website.&nbsp;</p>\r\n<p><a href=\"/brandon-kersh\">&nbsp;</a></p>\r\n<table style=\"width: 100%;\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\">\r\n<table style=\"width: 204px; height: 54px;\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a href=\"http://uca.edu/\"><img src=\"/assets/UCALogo.png\" border=\"0\" alt=\"UCA\" width=\"41\" height=\"41\" align=\"middle\" /></a></td>\r\n<td><a href=\"http://www.cornell.edu/\"><img src=\"/assets/CornellLogo.png\" border=\"0\" alt=\"Cornell\" width=\"48\" height=\"48\" align=\"right\" /></a></td>\r\n<td>&nbsp; &nbsp;</td>\r\n<td><a href=\"http://www.nsf.gov/\"><img src=\"/assets/NSFLogo.png\" border=\"0\" alt=\"NSF\" width=\"48\" height=\"48\" align=\"absmiddle\" /></a>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','','','2013-02-15 19:33:15','2013-04-25 16:56:17'),(4,'Contributors','contributors',1,'<h2>Contributors</h2>\r\n<table style=\"width: 762px; height: 294px;\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"70%\">\r\n<h3>Cornell University</h3>\r\n<ul>\r\n<li><a href=\"http://people.psych.cornell.edu/~blf2/\" target=\"_blank\">Barbara L. Finlay, Ph.D.</a></li>\r\n<li><a href=\"http://node101.psych.cornell.edu/Darlington/index.htm\" target=\"_blank\">Richard B. Darlington, Ph.D.&nbsp;</a></li>\r\n<li>Alan Workman</li>\r\n<li><a href=\"http://community.frontiersin.org/people/ChristineCharvet/22466\" target=\"_blank\">Christine Charvet, Ph.D.</a> &nbsp;</li>\r\n</ul>\r\n</td>\r\n<td width=\"30%\">\r\n<p><img src=\"http://socialcomputing.uci.edu/sites/default/files/logos/cornellunilogo.gif\" border=\"0\" width=\"89\" height=\"86\" style=\"margin-top: 0px;\" /></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\">\r\n<h3>University of Central Arkansas &nbsp; &nbsp; &nbsp; &nbsp;