an class=\"slug-vol\">33</span><span class=\"slug-issue\">:</span><span class=\"slug-pages\">&nbsp;7368-7383.</span></a></h4>\r\n<h2>&nbsp;</h2>\r\n<h3><strong>Additional References:</strong></h3>\r\n<h4><strong>Original translating time model:</strong></h4>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pubmed/7777856\" target=\"_blank\">Finlay BL,&nbsp;Darlington RB. 1995.&nbsp;Linked regularities in the development and evolution of mammalian brains.&nbsp;<span>Science.</span>&nbsp;268:1578-84.</a></p>\r\n<h4>Heterochronic shifts in developmental schedules</h4>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pmc/articles/PMC2690025/\" target=\"_blank\">Dyer MA, Martins R, da Silva Filho M, Muniz JA, Silveira LC, Cepko CL, Finlay BL. 2009. Developmental sources of conservation and variation in the evolution of the primate eye. Proc Natl Acad Sci U S A. 106:8963-8. doi: 10.1073/pnas.0901484106.&nbsp;</a></p>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pubmed/?term=The+developing+and+evolving+retina%3A+using+time+to+organize+form.\" target=\"_blank\">Finlay BL. 2008. The developing and evolving retina: using time to organize form. Brain Res. 1192:5-16.</a></p>\r\n<p><a href=\"http://evolution.binghamton.edu/evos/wp-content/uploads/2009/08/Finlay-2.pdf\" target=\"_blank\">Finlay BL, Silveira LCDL, Reichenbach A. 2005. Comparative aspects of visual system development. In:&nbsp;<em>The structure, function and evolution of the primate visual system</em>, &nbsp;J. Kremers, ed. John Wiley and Sons pp.&nbsp;37-72.&nbsp;</a></p>\r\n<h4>Overview of variation and conservation in developmental timing across species</h4>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pmc/articles/PMC3399120/\" target=\"_blank\"><span class=\"highlight\">Cahalane</span>&nbsp;DJ,&nbsp;Charvet CJ,&nbsp;<span class=\"highlight\">Finlay</span>&nbsp;BL. 2012.&nbsp;Systematic, balancing gradients in neuron density and number across the primate isocortex.&nbsp;<span>Front Neuroanat.</span>&nbsp;6:28. doi: 10.3389/fnana.2012.00028.</a></p>\r\n<p><a href=\"http://people.psych.cornell.edu/~blf2/pdfs/CJC,BLF-ProgressBrainRsrch2012.pdf\" target=\"_blank\">Charvet CJ, Finlay BL. 2012. Embracing covariation in brain evolution: large brains, extended development, and flexible primate social systems.&nbsp;Prog Brain Res.&nbsp;<em>195</em>, 71-87.</a></p>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pmc/articles/PMC3221253/\" target=\"_blank\">Charvet CJ,&nbsp;Striedter GF,&nbsp;<span class=\"highlight\">Finlay BL</span>. 2011.&nbsp;Evo-devo and brain scaling: candidate developmental mechanisms for variation and constancy in vertebrate brain evolution.&nbsp;<span>Brain Behav Evol.</span>&nbsp;78:248-57. doi: 10.1159/000329851.&nbsp;</a></p>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pubmed/?term=Finlay+BL%2C+Darlington+RB%2C+Nicastro+N.+Developmental+structure+in+brain+evolution.+Behav+Brain+Sci.+2001+Apr%3B24(2)%3A263-78%3B+discussion+278-308.\" target=\"_blank\">Finlay BL,&nbsp;Darlington RB,&nbsp;Nicastro N. 2001.&nbsp;Developmental structure in brain evolution.&nbsp;<span>Behav Brain Sci.</span>&nbsp;24:263-78; discussion 278-308.</a></p>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pubmed/9787222\" target=\"_blank\"><span class=\"highlight\">Finlay BL</span>,&nbsp;Hersman MN,&nbsp;Darlington RB.&nbsp;1998.&nbsp;Patterns of vertebrate neurogenesis and the paths of vertebrate evolution.&nbsp;<span>Brain Behav Evol.</span>&nbsp;52:232-42.</a></p>\r\n<h4>Variation and Conservation in developmental timing within species</h4>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pubmed/23363667\" target=\"_blank\">Charvet CJ,&nbsp;Darlington RB,&nbsp;<span class=\"highlight\">Finlay BL</span>. 2013.&nbsp;Variation in Human Brains May Facilitate Evolutionary Change toward a Limited Range of Phenotypes. Brain Behav Evol.&nbsp;81:74-85</a>.</p>\r\n<p><a href=\"http://www.ncbi.nlm.nih.gov/pmc/articles/PMC3130365/\" target=\"_blank\"><span class=\"highlight\">Finlay BL</span>,&nbsp;Hinz F,&nbsp;Darli