=\"77\">\r\n<h5><em>Ovis aries</em></h5>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"45\">\r\n<p>2.91</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"32\">\r\n<p>2.53</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"45\">\r\n<p>0.822</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"41\">\r\n<p>160</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"41\">\r\n<p>45000</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"50\">\r\n<p>147</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"59\">\r\n<h5><strong>Human</strong></h5>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"77\">\r\n<h5><em>Homo sapiens</em></h5>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"45\">\r\n<p>3.17</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"32\">\r\n<p>3.72</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"45\">\r\n<p>0.654</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"41\">\r\n<p>1350</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"41\">\r\n<p>70000</p>\r\n</td>\r\n<td valign=\"top\" nowrap=\"nowrap\" width=\"50\">\r\n<p>270</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>Brain (g) refers to Adult male brain weight (g); Weight (g) refers to Adult male body weight (g).</p>','','','2013-03-27 15:46:43','2013-04-24 21:15:53'),(11,'Student contributors','studentcontributors',NULL,'<p>Contributors</p>\r\n<p>&nbsp;</p>\r\n<p>2010-Present</p>\r\n<p>Alan Workman</p>\r\n<p>Nikki Kamura</p>\r\n<p>Christofer Gaffney</p>\r\n<p>&nbsp;</p>','','','2013-03-28 18:36:33','2013-03-28 20:13:10'),(12,'Brandon M. Kersh','brandon-kersh',1,'<h2>Brandon M. Kersh</h2>\r\n<table border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"50%\"><img src=\"/assets/brandon-kersh.jpg\" border=\"0\" width=\"286\" height=\"498\" /></td>\r\n<td width=\"50%\">\r\n<p>Brandon Marshall Kersh (1983 - 2007), was a young man who found his path in life, a love of science. His enthusiasm, dedication, and vision drove the initial establishment of a website where developmental time could be translated across species.</p>\r\n<p>This remarkable achievement occurred while he was an undergraduate at the University of Central Arkansas. One can only marvel at being so young, and leaving a legacy such as this. Brandon\'s brother, Travis Kersh, who is also a student at the University of Central Arkansas pays honor to his brother by being involved in the project. Brandon also conducted research at the University of Washington\'s Friday Harbor Research Laboratories and at NASA\'s AMES Research Center in California.</p>\r\n<p>Brandon was accepted into the PhD. program at the University of Arkansas for Medical Sciences and planned to obtain his degree in Neuroscience.</p>\r\n<p>Given Brandon\'s love of science it was his wish to become an organ donor. Many lives were changed that day, all because of Brandon.</p>\r\n<p>To be a part of Brandon\'s life was truly a gift. All those who knew and loved Brandon knew that he loved and lived life to the fullest.</p>\r\n<p>He was indeed like a shooting star. Gone too soon, but while here he was bright, brilliant, and beautiful.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','','','2013-04-18 17:11:37','2013-04-18 18:45:17'),(13,'Instructions','Instructions',1,'<h3><strong>Instructions for the use of this site.</strong></h3>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>In order to use the &ldquo;Translate&rdquo; and &ldquo;Predict&rdquo; functions, you should first note that all input and output is in <strong>Postconceptional Days (PC Days) and not Postnatal Days</strong>, an essential feature of the model as birth varies widely with respect to maturational state.&nbsp;&nbsp; If the information you presently have is in postnatal days, the information you need, and some considerations are described below.&nbsp; You must also have a particular class of events in mind for \"Translate\" or a specific event for &ldquo;Predict&rdquo;.&nbsp; By&nbsp; &ldquo;class of events&rdquo; we mean that the prediction depends in some cases on the <strong>Location </strong>of the event in the brain (typically a brain region but also includes \"Whole Brain\" for brain growth or &ldquo;Whole Organism&rdquo; for behavioral events). The maturational <strong>Process </strong>must also be identified. The <strong>Locations</strong> and <strong>Processes</strong> of particular importance are &ldquo;Cortex&rdquo;, &ldquo;Retina&rdquo;, and &ldquo;Neurogenesis&rdquo;.</p>\r\n<p>&nbsp;</p>\r\n<h4><strong>Postconceptional Day</strong></h4>\r\n<p>All days are estimated from conception, not birth. To calculate a postnatal day, subtract gestation length from the given output of Postconceptional Days. The gestation length for each species is listed in Species Information. In our model, birth is considered postnatal day 0, and all empirical studies are adjusted to that convention. &nbsp;For example, an event that occurs 10 days after birth will occur on &ldquo;Postnatal Day 9.&rdquo;&nbsp;The majority of studies follow this convention, although a few studies refer to birth as Postnatal day 1 .</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<h4><strong>Location and Process Classifications</strong></h4>\r\n<p>In the &ldquo;Translate&rdquo; section of the website, a user can select a post-conceptional date in any of our eighteen species and determine an analogous post-conceptional day for a different one of the species. Users need to select a location and a process for the comparison in question. There are 10 locations and 12 process classifications. In the current model, cortical neurogenesis is delayed in all non-glires species, and retinal neurogenesis is delayed in the cat, so any events corresponding to either of these combinations will have special transformations. There are 10 locations that can be selected from, and there are 12 processes. &nbsp;</p>\r\n<p>In the &ldquo;Predict&rdquo; section, the predicted timing for any of the 271 events can be determined for any of the 18 species, for a total of 4878 combinations.&nbsp;</p>\r\n<p>Below are descriptions of the locations and processes:</p>\r\n<p>&nbsp;<strong><span style=\"text-decoration: underline;\">Location</span></strong></p>\r\n<p>&nbsp;<strong>Brain Stem</strong> &ndash; Encompasses the spinal cord, medulla, and mesencephalon</p>\r\n<p>&nbsp;<strong>Cerebellum</strong> &ndash; The presumptive cerebellum</p>\r\n<p>&nbsp;<strong>Limbic System</strong> &ndash; Amygdala, hippocampus, septum, olfactory bulbs, olfactory cortex, subicular corticies, entorhinal cortex</p>\r\n<p>&nbsp;<strong>Thalamus</strong> &ndash; All thalamic nuclei</p>\r\n<p>&nbsp;<strong>Striatum</strong> &ndash; Globus pallidus, caudate nucleus</p>\r\n<p>&nbsp;<strong>Cortex</strong> &ndash; Isocortex</p>\r\n<p>&nbsp;<strong>Whole Brain</strong> &ndash; Gross brain growth</p>\r\n<p>&nbsp;<strong>Whole Organism </strong>&ndash; Behavioral events</p>\r\n<p>&nbsp;<strong>Sensory Periphery</strong> &ndash; Peripheral nervous system</p>\r\n<p>&nbsp;<strong>Retina</strong> &ndash; Retina, retinal ganglion cells</p>\r\n<p>&nbsp;<strong><span style=\"text-decoration: underline;\">Process</span></strong></p>\r\n<p><strong>Neurogenesis </strong>&ndash; Cell cycle exit for any group of cells</p>\r\n<p><strong>Axon Extension</strong> &ndash; When axons arrive at targets, form synapses, axon growth</p>\r\n<p><strong>Segregation</strong> &ndash; Differentiation of a population of cells</p>\r\n<p><strong>Gaba Cortex</strong> &ndash; Gabaergic cells that have origins in the striatum or isocortex</p>\r\n<p><strong>Subtractive Event</strong> &ndash; Cell death</p>\r\n<p><strong>Retinal Waves</strong> &ndash; Patterns of developing retinal activity</p>\r\n<p><strong>Synapse Elimination</strong> &ndash; Decrease in synapse numbers</p>\r\n<p><strong>Sensorimotor</strong> &ndash; Behavioral or reflexive event</p>\r\n<p><strong>Brain Growth</strong> &ndash; Gross brain development</p>\r\n<p><strong>Myelination</strong> &ndash; First wrap of a glial cell around a neuron</p>\r\n<p><strong>Electrophysiology</strong> &ndash; Onset of electrical activity<strong>&nbsp;</strong></p>','','','2013-04-24 16:43:42','2013-04-24 18:55:59');
